import{_ as r,o as s,c as d,a as t,b as o,w as n,e,d as a,r as c}from"./app.fd333fa4.js";const h={},p=e('<h1 id="pojecia" tabindex="-1"><a class="header-anchor" href="#pojecia" aria-hidden="true">#</a> Poj\u0119cia</h1><p>Poj\u0119cia zwi\u0105zane Misskey.</p><h2 id="activitypub" tabindex="-1"><a class="header-anchor" href="#activitypub" aria-hidden="true">#</a> ActivityPub</h2><p>Protok\xF3\u0142(metoda) u\u017Cywana do osi\u0105gni\u0119cia zdecentralizowanej natury Misskey. Wykorzystanie jego pozwala instancjom na komunikacje mi\u0119dzy sob\u0105, tworz\u0105c te\u017C rzecz nazywan\u0105 Fediwersum.</p><h2 id="aiscript" tabindex="-1"><a class="header-anchor" href="#aiscript" aria-hidden="true">#</a> AiScript</h2><p>J\u0119zyk programowania stworzony z my\u015Bl\u0105 o Misskey. <a href="/src/docs/advanced/aiscript">Zobacz tutaj po wi\u0119cej informacji</a></p><h2 id="api" tabindex="-1"><a class="header-anchor" href="#api" aria-hidden="true">#</a> API</h2><p>Jest to interfejs pozwalaj\u0105cy na operowanie Misskey za pomoc\u0105 programu, dost\u0119pne dla ka\u017Cdej instancji. <a href="/src/pl/docs/api">Wi\u0119cej informacji</a></p><h2 id="bot" tabindex="-1"><a class="header-anchor" href="#bot" aria-hidden="true">#</a> Bot</h2><p>Konto kontrolowane przez program.</p><h2 id="cw" tabindex="-1"><a class="header-anchor" href="#cw" aria-hidden="true">#</a> CW</h2>',11),u=a('Jest to skr\xF3t od "Ostrze\u017Cenie o tre\u015Bci". Funkcja ukrywaj\u0105ca zawarto\u015B\u0107 posta, chyba \u017Ce u\u017Cytkownik wyra\u017Anie za\u017C\u0105da jej pokazania. Zazwyczaj u\u017Cywana do ukrywania tre\u015Bci d\u0142ugich post\xF3w, spojler\xF3w albo materia\u0142\xF3w kontrowersyjnych. '),k=a("Wi\u0119cej informacji"),l=e('<h2 id="fediwersum" tabindex="-1"><a class="header-anchor" href="#fediwersum" aria-hidden="true">#</a> Fediwersum</h2><p>Sie\u0107 r\xF3\u017Cnych instancji korzystaj\u0105cych z innych platform kt\xF3re komunikuj\u0105 si\u0119 z sob\u0105, zaliczaj\u0105c w to Misskey.</p><h2 id="gtl" tabindex="-1"><a class="header-anchor" href="#gtl" aria-hidden="true">#</a> GTL</h2><p>Skr\xF3t od &quot;Global TimeLine&quot; - Globalna o\u015B czasu - <a href="/src/pl/docs/features/timeline">wi\u0119cej przeczytasz tutaj</a>.</p><h2 id="htl" tabindex="-1"><a class="header-anchor" href="#htl" aria-hidden="true">#</a> HTL</h2><p>Skr\xF3t od &quot;Home TimeLine&quot; - Tablica domowa/g\u0142\xF3wna, <a href="/src/pl/docs/features/timeline">wi\u0119cej przeczytasz tutaj</a></p><h2 id="ltl" tabindex="-1"><a class="header-anchor" href="#ltl" aria-hidden="true">#</a> LTL</h2><p>Skr\xF3t od &quot;Local TimeLine&quot; - Tablica lokalna, pokazuje wszystkie posty wys\u0142ane na instancji. <a href="/src/pl/docs/features/timeline">wi\u0119cej przeczytasz tutaj</a></p><h2 id="mfm" tabindex="-1"><a class="header-anchor" href="#mfm" aria-hidden="true">#</a> MFM</h2><p>Skr\xF3t od &quot;Markup language For Misskey&quot; - j\u0119zyk znacznik\xF3w do u\u017Cywania z Misskey - <a href="/src/pl/docs/features/mfm">wi\u0119cej przeczytasz tutaj.</a></p><h2 id="nsfw" tabindex="-1"><a class="header-anchor" href="#nsfw" aria-hidden="true">#</a> NSFW</h2><p>Skr\xF3t od &quot;Not Safe For Work&quot; - funkcja pozwalaj\u0105ca otagowa\u0107 zdj\u0119cie jako &quot;NSFW&quot;(Nie bezpieczne w pracy) i ukry\u0107 je za \u017Cyczeniem u\u017Cytkownika.</p><h2 id="renote" tabindex="-1"><a class="header-anchor" href="#renote" aria-hidden="true">#</a> Renote</h2>',13),z=a("Cytowanie wys\u0142anego ju\u017C posta, udost\u0119pnianie istniej\u0105cego posta, lub post stworzony poprzez kt\xF3r\u0105\u015B z tych czynno\u015Bci - "),w=a("wi\u0119cej przeczytasz tutaj."),y=e('<h2 id="stl" tabindex="-1"><a class="header-anchor" href="#stl" aria-hidden="true">#</a> STL</h2><p>Skr\xF3t od &quot;Social TimeLine&quot; - Pokazuje posty zar\xF3wno z lokalnej instancji, jak i od os\xF3b kt\xF3re obserwujesz. <a href="/src/pl/docs/features/timeline">wi\u0119cej przeczytasz tutaj.</a></p><h2 id="ai-\u85CD" tabindex="-1"><a class="header-anchor" href="#ai-\u85CD" aria-hidden="true">#</a> Ai(\u85CD)</h2><p>Ai(\u85CD) to oficjalna maskotka Misskey.</p><h2 id="aktywni-uzytkownicy" tabindex="-1"><a class="header-anchor" href="#aktywni-uzytkownicy" aria-hidden="true">#</a> Aktywni u\u017Cytkownicy</h2><p>U\u017Cytkownicy wsr\xF3d wszytkich, kt\xF3rzy u\u017Cywaj\u0105 swojego konta</p><h2 id="instancja" tabindex="-1"><a class="header-anchor" href="#instancja" aria-hidden="true">#</a> Instancja</h2><p>Serwer otwarty do internetu, kt\xF3ry udost\u0119pnia us\u0142ug\u0119 jak na przyk\u0142ad Misskey.</p><h2 id="dodatkowe-emoji" tabindex="-1"><a class="header-anchor" href="#dodatkowe-emoji" aria-hidden="true">#</a> Dodatkowe Emoji</h2><p>Emoji dostarczone przez twoj\u0105 instancje. Emoji kt\xF3re nie s\u0105 dostarczone przez instacje, ale s\u0105 dost\u0119pne s\u0105 nazywane &quot;Emotikonami Unicode&quot;<a href="/src/pl/docs/docs/features/custom-emoji">Dowiedz si\u0119 wi\u0119cej</a></p><h2 id="panel-sterowania" tabindex="-1"><a class="header-anchor" href="#panel-sterowania" aria-hidden="true">#</a> Panel sterowania</h2><p>Panel z ustawieniami instancji dost\u0119pny dla Administrator\xF3w i moderator\xF3w</p><h2 id="wyciszenie" tabindex="-1"><a class="header-anchor" href="#wyciszenie" aria-hidden="true">#</a> Wyciszenie</h2><p>Jest to stan kiedy posty u\u017Cytkownika nie mog\u0105 by\u0107 ustawione na &quot;Publiczne&quot;. Mo\u017Ce by\u0107 nadane u\u017Cytkownikowi przez Moderacje.<a href="/src/pl/docs/features/silence">wi\u0119cej przeczytasz tutaj.</a></p><h2 id="kolejka-zadan" tabindex="-1"><a class="header-anchor" href="#kolejka-zadan" aria-hidden="true">#</a> Kolejka zada\u0144</h2><p>System u\u017Cywany do nadawania aktywno\u015Bci innych instancji itp.</p><h2 id="zawieszenie" tabindex="-1"><a class="header-anchor" href="#zawieszenie" aria-hidden="true">#</a> Zawieszenie</h2><p>Stan kt\xF3ry powoduje \u017Ce konto u\u017Cytkownika jest niedost\u0119pne.</p><h2 id="dysk" tabindex="-1"><a class="header-anchor" href="#dysk" aria-hidden="true">#</a> Dysk</h2><p>Funkcja pozwalaj\u0105ca u\u017Cytkownikowm organizowa\u0107 pliki jakie wrzucili do Misskey. <a href="/src/pl/docs/features/drive">wi\u0119cej przeczytasz tutaj.</a></p><h2 id="notki" tabindex="-1"><a class="header-anchor" href="#notki" aria-hidden="true">#</a> Notki</h2><p>Inaczej posty, mog\u0105 zawiera\u0107 tekst, obrazy, ankiety i wszystko to co zosta\u0142o wrzucone na Misskey. <a href="/src/pl/docs/docs/features/note">wi\u0119cej przeczytasz tutaj.</a></p><h2 id="misskit" tabindex="-1"><a class="header-anchor" href="#misskit" aria-hidden="true">#</a> Misskit</h2><p>U\u017Cytkownik Misskey.</p><h2 id="moderator" tabindex="-1"><a class="header-anchor" href="#moderator" aria-hidden="true">#</a> Moderator</h2><p>Osoba zarz\u0105dzaj\u0105ca spo\u0142eczno\u015Bci\u0105 instancji poprzez wy\u0142\u0105cznie kont spam, wyciszaj\u0105c konta, usuwaj\u0105c nieodpowiednie posty itp.</p><h2 id="license" tabindex="-1"><a class="header-anchor" href="#license" aria-hidden="true">#</a> License</h2><p>Dokument kt\xF3ry okre\u015Bla\u0142 legalne wykorzystanie zasobu.</p><h2 id="remote-zdalne" tabindex="-1"><a class="header-anchor" href="#remote-zdalne" aria-hidden="true">#</a> Remote/Zdalne</h2><p>U\u017Cywane w kontek\u015Bcie instancji innej ni\u017C twoja. R\xF3wnie\u017C u\u017Cywane jako prefiks w terminach &quot;zdalny u\u017Cytkownik&quot;. Przeciwie\u0144stwo &quot;Lokalne&quot;</p><h2 id="federacja" tabindex="-1"><a class="header-anchor" href="#federacja" aria-hidden="true">#</a> Federacja</h2><p>Udost\u0119pnianie informacji stworzonych na jednej instancji z inn\u0105 instancj\u0105.</p><h2 id="lokalne" tabindex="-1"><a class="header-anchor" href="#lokalne" aria-hidden="true">#</a> Lokalne</h2><p>U\u017Cywane w kontek\u015Bcie twojej instancji. U\u017Cywane jako prefiks w terminach jak &quot;Lokalni u\u017Cytkownicy&quot;, &quot;Lokalna o\u015B czasu&quot;. Przeciwie\u0144stwo &quot;zdalnej&quot;</p>',34);function j(f,m){const i=c("RouterLink");return s(),d("div",null,[p,t("p",null,[u,o(i,{to:"/pl/docs/src/pl/docs/features/note.html#cw"},{default:n(()=>[k]),_:1})]),l,t("p",null,[z,o(i,{to:"/src/pl/docs/docs/features/note.html#renote"},{default:n(()=>[w]),_:1})]),y])}var x=r(h,[["render",j],["__file","glossary.html.vue"]]);export{x as default};
